import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function History() {
  const navigate = useNavigate();
  const [history, setHistory] = useState([]);
  const user = JSON.parse(localStorage.getItem('user'));

  useEffect(() => {
    axios.get(`http://localhost:8080/api/history/${user.id}`)
      .then(res => {
        if (res.data.success) {
          setHistory(res.data.uploads);
        }
      }).catch(() => {});
  }, [user.id]);

  return (
    <div className="container mt-5">
      <h3>Your Upload History</h3>
      <table className="table mt-3">
        <thead>
          <tr>
            <th>Filename</th>
            <th>AI %</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {history.map((item, index) => (
            <tr key={index}>
              <td>{item.filename}</td>
              <td>{item.percentAI}%</td>
              <td>{item.timestamp}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <button className="btn btn-secondary mt-3" onClick={() => navigate('/dashboard')}>Back to Dashboard</button>
    </div>
  );
}

export default History;
